import React from 'react';
import { useParams } from 'react-router-dom';

interface Params {
    id: string;
}

function Team() {
    const { id } = useParams<Params>();
    return (
        <div>
            <h1> Page des Teams</h1>
        </div>
    );
}

export default Team;
